module.exports = "<div id=\"faq\">\n  <dl>\n    <dt class=\"kingbasil\">When & Where </dt>\n    <dd>\n      <p>June 8, 2019</p>\n      <p>Pebble Cove Farm, 3341 Deer Harbor Rd, Eastsound, WA</p>\n      <p>Full schedule of events TBD. RSVP to be notified when weve made updates to our website! Were so excited that youre coming, and we strongly suggest making a weekend out of your trip to the islands, as theres a lot to see and do! But if youre not able to arrive the day/night before, we advise you to book a ferry that will arrive on Orcas Island the morning of June 8 so you have plenty of time to settle in beforehand. Please keep in mind that the only way to get to Orcas Island is by ferry, and you should definitely book tickets for it in advance. See Travel for more info.</p>\n    </dd>\n    <dt class=\"kingbasil\">Accomodations </dt>\n    <dd>\n      <p>Orcas Island has a few hotels scattered around, as well as options through AirBnB. Make sure to book quickly, as things do get snatched up pretty fast!</p>\n      <p>This link (<a href=\"https://www.guidetosanjuans.com/listings/orcas-island/featured-lodging/\">https://www.guidetosanjuans.com/listings/orcas-island/featured-lodging/</a>) has a list of hotels and inns.</p>\n      <p>If you need help finding a place to stay, please email <span class=\"bold\">taylor.rebecca.eke@gmail.com</span>.</p>\n    </dd>\n    <dt class=\"kingbasil\">Travel </dt>\n    <dd>\n      <p>The only way to reach Orcas Island is via ferry from Anacortes, WA. It holds cars too, so that way you can have your car on the island with you. Reservations for the Anacortes ferry to Orcas Island must be made in advance and are available starting January 31 for our wedding date and can be found here.</p>\n      <p class=\"bold\">Getting to the ferry:</p>\n      <p>From Seattle take I-5 north. Exit 230 onto Route 20 West. Route 20 begins as a two-lane road and travels through miles of farmland. It then turns into a four-lane road and crosses a long bridge onto Fidalgo Island. You will pass a casino and wind up and around into Anacortes. In town, Route 20 veers right onto Commercial Street. Stay on Commercial Street for four lights and then turn left at 12th street. There is a sign for the ferry with an arrow. It is well marked, but you can also look for the large Safeway grocery store on the right and the Chevron Gas Station on the left. The ferry landing is approximately 2.5 miles ahead from this intersection.</p>\n    </dd>\n    <dt class=\"kingbasil\">FAQ </dt>\n    <dt>When should I get there?</dt>\n    <dd>\n      <p>Were still working out a full schedule of events, and you can RSVP to be notified when its up, but wed advise you to get to the island the day before to get your bearings and to settle in. Ideally, you should plan to stay the weekend and island hop! All of the San Juan Islands are beautiful and worth exploring.</p>\n    </dd>\n    <dt>What should I wear?</dt>\n    <dd>\n      <p>Semi-formal attire is ideal, but dont stress too much! As long as you dont wear a white dress, youre probably fine. </p>\n      <p>A few things to keep in mind: The wedding and reception will be on the lawn, so plan your footwear accordingly! Also, the island (and the Pacific Northwest in general) can get chilly when the sun goes down so you might want to bring a light jacket.</p>\n    </dd>\n    <dt>Do you have a registry?</dt>\n    <dd>\n      <p>Instead of a registry, were asking for donations to help us get to our honeymoon in Fiji! To donate, <a id=\"giftLink\">click here</a>. Vinaka! (That means Thank you in Fijian).</p>\n      <p>A few things to keep in mind: The wedding and reception will be on the lawn, so plan your footwear accordingly! Also, the island (and the Pacific Northwest in general) can get chilly when the sun goes down so you might want to bring a light jacket.</p>\n    </dd>\n    <dt>Do I need a car on the island?</dt>\n    <dd>\n      <p>To be honest, youll probably want one. Depending on where youre staying, youll want to be able to drive to the venue and back and use it to go into town, the beach, Mount Constitution, etc as the island isnt super walkable everywhere. Keep in mind that rental cars on the island are extremely limited, so plan to rent one before taking the ferry if need be.</p>\n    </dd>\n    <dt>How long have you guys been together?</dt>\n    <dd>\n      <p>Glad you asked! After talking for a month or so on Tinder (yes, Tinder!) we had our first official date on January 20, 2015 at the Portland waterfront, where I insisted he bring Subie along too. Weve been going strong ever since and cant wait to see where this next chapter takes us!</p>\n    </dd>\n    <dt>Will there be food?</dt>\n    <dd>\n      <p>Yes, you will be fed! There will be appetizers and dinner as well as drinks. Oh, and cake, because what good is a wedding without cake?!</p>\n    </dd>\n    <dt>I heard there are farm animals...is that true?</dt>\n    <dd>\n      <p>Yes! Pebble Cove Farm is a working farm with chickens, goats and two pot-bellied pigs that you might spot during our ceremony!</p>\n    </dd>\n    <dt>You guys have a wedding hashtag dont you.</dt>\n    <dd>\n      <p>Technically not a question, but yes, we do! Its <span class=\"bold\">#meettheekes</span>, which also tells you how to pronounce our last name! Please use <span class=\"bold\">#meettheekes</span> when you post your photos on social media so we can see them!</p>\n    </dd>\n    <dt>Contact Us</dt>\n    <dd>\n      <p>If you need help with anything, please feel free to email us at <span class=\"bold\">taylor.rebecca.eke@gmail.com</span> or you can text/ask us in person!</p>\n    </dd>\n  </dl>\n</div>\n";

